solution:
Let's write the first sentence as an equation: \begin{align*}
\frac{x}{y} &= \frac{1}{2}, \\
2x &= y.
\end{align*}

Now, we can substitute this into the given equation to find $x$: \begin{align*}
2x &= 4x - 36, \\
36 &= 2x, \\
\boxed{18} &= x.
\end{align*}

